    false,nt"url": null,nt"notes": "<p>This release contains the Basic Stand
    Alone (BSA) Carrier Line Items Public Use Files (PUF) with information from Medicare
    Carrier claims. The CMS BSA Carrier Line Items PUF is a line item level file in
    which each record is a line item of a Carrier claim incurred by a 5 percent sample
    of Medicare beneficiaries. Some demographic and line item related variables are
    provided in this PUF as detailed below. However, as beneficiary identities are not
    provided, it is not possible to link claims that belong to the same beneficiary
    in the CMS BSA Carrier Line Items PUF. It is also not possible to link line items
    that belong to the same claim.</p>n",nt"license_title": "License Not Specified",nt"extras":
